//import axios from "axios";
import React, { Component } from "react";
import api  from '../../main';
class Prest_Serv extends Component{

    state = {
        prestadores: [],
    }

    async componentDidMount(){
        const response = await api.get()
        
        // console.log(response.data)

        this.setState({ prestadores: response.data });
    }

    render(){

        const { prestadores } = this.state

        return(
            <div> 
                <h3> Prestadores: </h3>
                {/* {console.log(prestadores)} */}
                {prestadores.map(prestadores => (
                    <ul>
                        <li key = {prestadores.id}>
                            <h5></h5><strong>Nome: </strong> {prestadores.nome}
                            <strong>GÃªnero: </strong> {prestadores.genero}
                            <strong>Email: </strong> {prestadores.email}
                            <strong>Cnpj: </strong> {prestadores.cnpj}
                            <strong>Especialidade: </strong> {prestadores.especialidade}
                        </li>
                    </ul>
                        
                ))}
            </div>
        );
    };
};

export default Prest_Serv
